import React from 'react'
import Container from 'react-bootstrap/Container';
import { useState, useEffect } from 'react'
import { Link, useParams } from 'react-router-dom'
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import 'bootstrap/dist/css/bootstrap.min.css';
import Scrollspy from 'react-scrollspy';


const HomeNav = () => {
  return (
    <Navbar collapseOnSelect expand="lg" bg="white" className="navbar">
      <Container>
        <Navbar.Brand href="/">Cody McCarney</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
          </Nav>
            <Scrollspy items={ ['section-1', 'section-2', 'section-3'] } className="sections" currentClassName="is-current">
              <Nav.Link href="/" className='nav-link'>Home</Nav.Link>
              <Nav.Link href="#deets" className='nav-link'>About</Nav.Link>
              <Nav.Link href="#memes" className='nav-link'>Profficiencies</Nav.Link>
              <Nav.Link href="#memes" className='nav-link'>Projects</Nav.Link>
              <Nav.Link href="#memes" className='nav-link'>Timeline</Nav.Link>
            </Scrollspy>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  )
}

export default HomeNav;
